import React from 'react';
import Navbar from './Navbar'; 
//import Footer from './Footer'; 
import myportrait from '../assets/Turambe.jpg';
import '../mycss/About.css'; 

function About() {
  return (
    <div>
      <Navbar /> {/* Include the Navbar component */}
      <div className="profile-container">
        <div className="profile-details">
          <h2>About Me</h2>
          <p>Add your details here...</p>
        </div>
        <div className="profile-picture">
          <img src={myportrait} alt="my Profile" />
        </div>
        <div className="profile-social">
          <h2>Social Links</h2>
          <ul>
            <li><a href="https://github.com/Jaycee90">GitHub</a></li>
            <li><a href="https://www.linkedin.com/in/Jayce90/">LinkedIn</a></li>
            {/* Add more social links as needed */}
          </ul>
        </div>
        <div className="profile-education">
          <h2>Education</h2>
          <p>Add your education info here...</p>
        </div>
      </div>
      <Footer />
    </div>
  );
}

export default About;
